import React, { useState } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default function Logout() {
    return (
        <div>
            <div className="logout-button" onClick={() => LogoutUser()}>Account Info</div>
        </div>
    )
    function LogoutUser() {
        <Route path='/logout'></Route>
    }
}
